#include <iostream>
using namespace std;

int commonPrefix(string &s){
    int sum = s.size();
    for(int i=1; i<s.size(); i++){
        int j=0; 
        while(i+j<s.size()){
            if(s[i+j]!=s[j]) break;
            j++;
        }
        sum+=j;
    }
    return sum;
}
int main() {
	// your code goes here
	ios_base::sync_with_stdio(false);
	cin.tie(NULL);
	int t; 
	cin>>t;
	while(t--){
	    string s;
	    cin>>s;
	    cout<<commonPrefix(s)<<endl;
	}
	return 0;
}


